import * as React from 'react';
import { TextInput, View, StyleSheet, TouchableOpacity } from 'react-native';
import  Ionicons  from 'react-native-vector-icons/Ionicons';


function SearchComponent(drawer, props) {
    return (
        <View style={{height:60, padding: 10, alignItems:'center', backgroundColor:'#8a2be2', flexDirection:'row'}} {...drawer}>    
            <TouchableOpacity style={{flex:1}} onPress={()=> drawer.navigation.toggleDrawer()}>
                <Ionicons name='md-menu' size={50} color={'white'}/>
            </TouchableOpacity>
            <View style={{backgroundColor: 'white', alignItems:'center',flexDirection:'row', flex: 5, borderRadius:40}}>
                <Ionicons name='md-search' size={30} style={{marginLeft:10}}/>
                <TextInput placeholder='Search' />
            </View>
            <TouchableOpacity style={{flex:1}} onPress={()=> props.navigation.navigate('DetailUser')}>
                <Ionicons name='ios-person' size={40} color={'white'} style={{marginLeft:10}}/>
            </TouchableOpacity>
        </View>
    );
}
export  {SearchComponent}
